INSERT INTO `ni8_pnews` (`id`, `title`, `text`, `spic`, `mpic`, `classid`, `link_id`, `ly`, `anthor`, `hits`, `addtime`, `content`, `t`, `k`, `d`, `sort`, `passed`, `tj`, `qy`, `pl`) VALUES
(1, '人气爆棚！多位大咖齐聚泸州，聊聊酒业发展那些...', '', '../upfile/admin/image/20170601/20170601180100_25227.jpg', NULL, 1, '|1|', NULL, NULL, 10, '2017-06-01 17:59:32', '<p>\r\n	2016年，我们看到了少数高端白酒的率先回暖，但与此同时，大多数的白酒企业，仍在原地踏步，销量每年都在徘徊。总体上，白酒行业目前还处于一个调整的状态，少数回暖、多数徘徊。\r\n</p>\r\n<p>\r\n	2017年对酒企来说将是关键的一年。行业进一步复苏回暖是否会从一线名优酒企延续到区域酒企？在2016年逆势增长的企业之外，2017年接下来增长的企业将是谁？认清方向才能做出正确的选择。但是，方向在哪里？白酒市场的新商机在哪里？市场趋势如何？行业热点有哪些？2017年，酒企该如何掌握增长的方法路径？酒业家对您的困惑一一道来！\r\n</p>\r\n<p>\r\n	2017成都春糖，酒业家将携多场论坛与中国酒业人士共话酒业大趋势。从2月16日起，酒业家系列论坛欢迎您免费报名参加！如果你是做酒人，酒业家系列论坛定是为你“传经送宝”的不二选择。作为主论坛的中国酒业市场论坛，酒业家已成功举办5届，论坛内容涉及酒业市场、渠道、终端、电商、行业趋势等多方面，每届论坛都吸引了超过千名酒业人的捧场，现场人气火爆，在业内好评如潮。\r\n</p>\r\n<p>\r\n	在往年的糖酒会，酒业家曾邀请到贵州茅台酒销售有限公司董事长王崇琳，泸州老窖股份公司销售公司常务副总经理、泸州老窖博大酒业公司总经理李小刚、阿里巴巴天猫酒水事业部负责人谢茂林、京东商城消费品事业部酒类采销部总经理王志强等众多大咖到会并发表精彩演讲。\r\n</p>\r\n<p>\r\n	2017年春糖，酒业家将一如继往邀请行业一线大咖，探寻行业热点、商业机会、市场趋势、创新模式……\r\n</p>\r\n<p>\r\n	除了中国酒业市场论坛以外，今年春糖，酒业家还新增了多场专业程度更高的论坛，如聚焦葡萄酒市场的第三届中国进口酒市场论坛、关注新品类的2017中国健康白酒论坛等，给各位酒友提供最专业、最深度、最前沿的讯息和观点。\r\n</p>', '', '', '', 0, 1, 1, 1, 1),
